import React from 'react'
import '../styles/lien.css'


export default function Navbar() {
    return (
     <nav> 

        <link to="/"></link>
        <link to="/APropos"></link>

        <a className='lien-nav' href="/">Home</a>
        <a className='lien-nav' href="/APropos">A propos </a>


     </nav>
    )

}
